import React, { Component, Fragment } from 'react';
import { NavigationWrapper, NavItem } from './NavBar.styled.js';

class NavBar extends Component {
  constructor(props){
    super(props);
    this.state={
      selectedItem: 'home'
    };
  }

  render() {
    return (
      <NavigationWrapper>
        <NavItem selected={this.state.selectedItem === 'home'}>HOME</NavItem>
        <NavItem selected={this.state.selectedItem === 'about'}>ABOUT</NavItem>
        <NavItem selected={this.state.selectedItem === 'camps'}>CAMPS</NavItem>
        <NavItem selected={this.state.selectedItem === 'testimonials'}>TESTIMONIALS</NavItem>
        <NavItem selected={this.state.selectedItem === 'contact'}>CONTACT</NavItem>
      </NavigationWrapper>
    );
  }
}

export default NavBar;
